import React from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";

const Main = (props, context) => (
  <div className={styles.main}>
      <div className={styles.middlebox}>
        <svg width="1200" height="200" viewBox="0 0 400 200"> 
          <text x="30" y="65%">M</text> 
          <text x="150" y="65%">Y</text>
          <text x="220" y="65%">M</text>
          <text x="330" y="65%">M</text>
          <text x="430" y="65%">R</text>
          <text x="480" y="65%">.</text>
          <text x="500" y="65%">K</text>
          <text x="580" y="65%">R</text>
        </svg>
      </div>
  </div>
  
);

Main.propTypes = {
};

export default Main;
